import Slider from "react-slick";

const Projet = ({ titre, techno, description, imageSrc, link }) => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1
  };

  return (
    <div className="projet">
      <h4>{titre}</h4>
      <h5>Technologies utilis√©es: {techno}</h5>
      <p>{description}</p>
      <Slider {...settings}>
        <div>
          <img src={imageSrc} alt={titre + " - Image 1"} />
        </div>
      </Slider>
      <p>{link}</p>
    </div>
  );
};
